import React from 'react';
import '/Users/shivaniuppe/Desktop/port/src/Projects.css';
 // Link to the CSS file

function Projects() {
    return (
        <div className="projects">
            <h1 className="projects-title">PROJECTS</h1>
            <div className="project-categories">
                <button className="category-button active">ALL</button>
                <button className="category-button">GRADUATE PROJECTS</button>
                <button className="category-button">PERSONAL PROJECTS</button>
            </div>
            <div className="project-card">
                <h2 className="project-name">Code Clone Detection</h2>
                <p>The project aims at finding code repeats or repeated strings within the codebase.</p>
                <h3>Features</h3>
                <ul>
                    <li>Choose a repository to detect repeated strings.</li>
                    <li>Select Barenbaum Algorithm or Beller Algorithm for finding repeats strings.</li>
                    <li>Repeated Strings Files are displayed in JSON Format.</li>
                </ul>
                <button className="github-button">Github URL</button>
            </div>
            <div className="project-card">
                <h2 className="project-name">Document Manager</h2>
                <p>A document manager service similar to Dropbox.</p>
                {/* Add other project details similarly */}
            </div>
        </div>
    );
}

export default Projects;
